import React from 'react';

import SkincarePreview from '../../components/collection-preview/skincare-preview.component';
import {connect} from 'react-redux';
import {createStructuredSelector} from 'reselect';
import selectCollectionsPreview from '../../redux/collection-preview/collection-preview.selector';


import './skincare-collection-preview.style.css';



const ShopSkincareProducts = ({ collections }) => (
    <div className = "shop-skincarePage-container">
        {
            collections.filter((idx) => idx < 6).map( ({id, ...otherCollectionsProps}) => (
                <SkincarePreview key={id} {...otherCollectionsProps}/>
            ))
        }
    </div>
);

const mapStateToProps = createStructuredSelector({
    collections: selectCollectionsPreview
});

export default connect(mapStateToProps)(ShopSkincareProducts);
